import styled from "styled-components";
import Fundo3 from '../../components/img/fundo7.jpg'

export const Fundo = styled.div`
  background: url(${Fundo3}) no-repeat right;
  width: 100%;
	height: 100vh;
	background-size: cover;
	text-align: center;
	padding: 5% 0;
  overflow-x: hidden;
	@media (max-width: 700px) {
		width: 100%;
		background-size: auto;
	}
`
